function Login() {
  return (
    <div style={{ padding: '1rem', textAlign: 'center' }}>
      <h2>Login</h2>
      <form>
        <input placeholder="Username" /><br /><br />
        <input placeholder="Password" type="password" /><br /><br />
        <button type="submit">Login</button>
      </form>
    </div>
  );
}
export default Login;
